import React from "react";

const Projects = () => {
  return (
    <div className="card">
      <h2>Projects</h2>
      <ul>
        <li>Project 1</li>
        <li>Project 2</li>
        <li>Project 3</li>
        <li>Project 4</li>
        <li>Project 5</li>
      </ul>
    </div>
  );
};

export default Projects;
